import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import {Forms} from './components/Form';

function App() {
  return (
    <Router>
    <div className="App">
      <Forms/>
    </div>
    </Router>
  );
}

export default App;
